import styles from './TemplateCard.module.css';

type Props = {
  name: string;
  content: string;
  lastModified: string;
};

export default function TemplateCard({ name, content, lastModified }: Props) {
  return (
    <div className={styles.card}>
      <div className={styles.title}>{name}</div>
      <div className={styles.meta}>Last Modified: {lastModified}</div>
      <div className={styles.content}>{content}</div>
    </div>
  );
}
